import AppBar from '@material-ui/core/AppBar';

import './commom.css'

const Header = (props) => {
    return (
        <AppBar position="static" color={props.color}>
            <div className="header">
                <p className="title"> Portal de Not√≠cias</p>
            </div>
        </AppBar>
    )

}


export default Header;
